    "contracts/RUNGOOOS.sol": {
      "content": "// SPDX-License-Identifier: Unlicensed
pragma solidity ^0.8.19;

import { ERC721A } from "erc721a/contracts/ERC721A.sol";
import { Ownable } from "@openzeppelin/contracts/access/Ownable.sol";
import { ERC2981 } from "@openzeppelin/contracts/token/common/ERC2981.sol";
import { DefaultOperatorFilterer } from "operator-filter-registry/src/DefaultOperatorFilterer.sol";

contract RUNGOOOS is ERC721A, ERC2981, Ownable, DefaultOperatorFilterer {
  /**
   * @notice Is minting paused.
   */
  bool public mintPaused;
  /**
   * @notice Current minting price.
   */
  uint256 public mintPrice = 6 ether;
  /**
   * @notice Current maximum collection supply.
   */
  uint256 public maxSupply = 25000;
  /**
   * @notice Current mint limit per transaction.
   */
  uint256 public maxMintPerTx = 25;
  /**
   * @notice Current mint limit per wallet.
   */
  uint256 public maxMintPerWallet = 25;
  /**
   * @notice Current hidden metadata URI.
   */
  string public hiddenURI = "ipfs://bafybeiev7hxfgbhklseumqkenoriy5yeku3on2jpzpgxap4jrbgx6gmize/rungoos_hidden.json";
  /**
   * @notice Current revealed metadata URI.
   */
  string public revealedURI;
  /**
   * @notice Current metadata URI suffix.
   */
  string public uriSuffix = ".json";

  constructor() ERC721A("RUNGOOOS", "RGNS") {
    _setDefaultRoyalty(0xd7BE8CEF743D5C1cA6047C3530A857f7cf3D7618, 500);
  }

  ///////////////////////////////
  ///      MINT FUNCTIONS
  ///////////////////////////////

  /**
   * @notice Mints `_mintAmount` tokens on public sale.
   * @dev Requirements: Price compliance.
   * Limits active: Transaction, Wallet, Max supply
   */
  function mintPublic(uint256 _mintAmount) public payable {
    require(!mintPaused, "Minting is paused");
    require(_mintAmount > 0, "Invalid mint amount");
    require(msg.value >= mintPrice * _mintAmount, "Insufficient funds");
    require(_mintAmount <= maxMintPerTx, "Mint amount exceeds max per tx");
    require(totalSupply() + _mintAmount <= maxSupply, "Max supply exceeded");
    require(balanceOf(msg.sender) + _mintAmount <= maxMintPerWallet, "Mint amount exceeds max per wallet");

    _safeMint(msg.sender, _mintAmount);
  }

  /**
   * @notice Mints `_mintAmount` tokens to `_receiver` without cost.
   * @dev Requirements: Caller must be owner.
   * Limits active: Max supply.
   */
  function mintOwner(uint256 _mintAmount, address _receiver) public onlyOwner {
    require(totalSupply() + _mintAmount <= maxSupply, "Max supply exceeded");

    _safeMint(_receiver, _mintAmount);
  }

  ///////////////////////////////
  ///    CONTRACT GETTERS
  ///////////////////////////////

  /**
   * @notice Get URI for `tokenId`.
   * @dev Requirements: Existing token.
   * @return string token URI if revealed, else hidden metadata URI
   */
  function tokenURI(uint256 tokenId) public view override(ERC721A) returns (string memory) {
    require(_exists(tokenId), "Token does not exist");

    return bytes(revealedURI).length > 0 ? string(abi.encodePacked(revealedURI, _toString(tokenId), uriSuffix)) : hiddenURI;
  }

  /**
   * @notice Get token IDs owned by `ownerAddress`.
   * @param ownerAddress address to query
   * @return uint256[] Array of token id's
   */
  function tokensOfOwner(address ownerAddress) external view returns (uint256[] memory) {
    unchecked {
      uint256 tokenIdsIdx;
      address currOwnershipAddr;
      uint256 tokenIdsLength = balanceOf(ownerAddress);
      uint256[] memory tokens = new uint256[](tokenIdsLength);
      TokenOwnership memory ownership;
      for (uint256 i = _startTokenId(); tokenIdsIdx != tokenIdsLength; ++i) {
        ownership = _ownershipAt(i);
        if (ownership.burned) {
          continue;
        }
        if (ownership.addr != address(0)) {
          currOwnershipAddr = ownership.addr;
        }
        if (currOwnershipAddr == ownerAddress) {
          tokens[tokenIdsIdx] = i;
          tokenIdsIdx++;
        }
      }
      return tokens;
    }
  }

  ///////////////////////////////
  ///    CONTRACT SETTERS
  ///////////////////////////////

  /**
   * @notice Set hidden metadata URI.
   * @param uri format ipfs://hidden_uri/
   * @dev Requirements: Owner
   */
  function setHiddenUri(string calldata uri) public onlyOwner {
    hiddenURI = uri;
  }

  /**
   * @notice Set revealed metadata URI.
   * @param uri format ipfs://revealed_uri/
   * @dev If set collection will be revealed
   * Requirements: Owner
   */
  function setRevealedUri(string calldata uri) public onlyOwner {
    revealedURI = uri;
  }

  /**
   * @notice Set suffix for token URI constructor.
   * @param suffix default .json
   * @dev Requirements: Owner
   */
  function setUriSuffix(string calldata suffix) public onlyOwner {
    uriSuffix = suffix;
  }

  /**
   * @notice Set new mint price.
   * @param newPrice price in wei
   * @dev Requirements: Owner
   */
  function setPrice(uint256 newPrice) public onlyOwner {
    mintPrice = newPrice;
  }

  /**
   * @notice Set maximum mint per transaction limit.
   * @param amount new limit
   * @dev Requirements: Owner
   */
  function setMaxMintPerTx(uint256 amount) public onlyOwner {
    maxMintPerTx = amount;
  }

  /**
   * @notice Set minting state.
   * @param state true = minting paused / false = minting resumed
   * @dev FOR EMERGENCY USE ONLY.
   * Requirements: Owner
   */
  function setMintPaused(bool state) public onlyOwner {
    mintPaused = state;
  }

  /**
   * @notice Set maximum collection supply.
   * @param amount must be less than totalSupply
   * @dev Requirements: Owner
   */
  function setMaxSupply(uint256 amount) public onlyOwner {
    require(amount >= totalSupply(), "Amount cannot be lower than total supply");

    maxSupply = amount;
  }

  ///////////////////////////////
  ///    ROYALTY FUNCTIONS
  ///////////////////////////////

  /**
   * @notice Set default royalty information.
   * @param receiver Receiver address
   * @param feeNumerator Percentage (1% would be 100)
   * @dev Requirements: Owner
   */
  function setDefaultRoyalty(address receiver, uint96 feeNumerator) public onlyOwner {
    _setDefaultRoyalty(receiver, feeNumerator);
  }

  /**
   * @notice Reset default royalty information.
   * @dev Requirements: Owner
   */
  function deleteDefaultRoyalty() public onlyOwner {
    _deleteDefaultRoyalty();
  }

  ///////////////////////////////
  ///           MISC
  ///////////////////////////////

  function _startTokenId() internal view virtual override returns (uint256) {
    return 1;
  }

  /**
   * @notice Get supported interface information.
   */
  function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721A, ERC2981) returns (bool) {
    return interfaceId == 0x780e9d63 || interfaceId == 0x80ac58cd || interfaceId == 0x5b5e139f || super.supportsInterface(interfaceId);
  }

  /**
   * @notice Withdraw contract funds.
   * @dev Requirements: Owner
   */
  function withdrawFunds() external onlyOwner {
    (bool transfer, ) = payable(owner()).call{ value: address(this).balance }("");
    require(transfer);
  }

  ///////////////////////////////
  ///    OPENSEA OVERRIDES
  ///////////////////////////////

  function setApprovalForAll(address operator, bool approved) public override(ERC721A) onlyAllowedOperatorApproval(operator) {
    super.setApprovalForAll(operator, approved);
  }

  function approve(address operator, uint256 tokenId) public payable override(ERC721A) onlyAllowedOperatorApproval(operator) {
    super.approve(operator, tokenId);
  }

  function transferFrom(address from, address to, uint256 tokenId) public payable override(ERC721A) onlyAllowedOperator(from) {
    super.transferFrom(from, to, tokenId);
  }

  function safeTransferFrom(address from, address to, uint256 tokenId) public payable override(ERC721A) onlyAllowedOperator(from) {
    super.safeTransferFrom(from, to, tokenId);
  }

  function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory data) public payable override(ERC721A) onlyAllowedOperator(from) {
    super.safeTransferFrom(from, to, tokenId, data);
  }
}
"
